component.schema:
{
 "description": "JWTProvider is the Schema for the jwtproviders API.",
 "properties": {
  "spec": {
   "description": "JWTProviderSpec defines the desired state of JWTProvider",
   "properties": {
    "audiences": {
     "description": "Audiences is the set of audiences the JWT is allowed to access.\nIf specified, all JWTs verified with this provider must address\nat least one of these to be considered valid.",
     "items": {
      "type": "string"
     },
     "type": "array"
    },
    "cacheConfig": {
     "description": "CacheConfig defines configuration for caching the validation\nresult for previously seen JWTs. Caching results can speed up\nverification when individual tokens are expected to be handled\nmultiple times.",
     "properties": {
      "size": {
       "description": "Size specifies the maximum number of JWT verification\nresults to cache.\n\n\nDefaults to 0, meaning that JWT caching is disabled.",
       "type": "integer"
      }
     },
     "type": "object"
    },
    "clockSkewSeconds": {
     "description": "ClockSkewSeconds specifies the maximum allowable time difference\nfrom clock skew when validating the \"exp\" (Expiration) and \"nbf\"\n(Not Before) claims.\n\n\nDefault value is 30 seconds.",
     "type": "integer"
    },
    "forwarding": {
     "description": "Forwarding defines rules for forwarding verified JWTs to the backend.",
     "properties": {
      "headerName": {
       "description": "HeaderName is a header name to use when forwarding a verified\nJWT to the backend. The verified JWT could have been extracted\nfrom any location (query param, header, or cookie).\n\n\nThe header value will be base64-URL-encoded, and will not be\npadded unless PadForwardPayloadHeader is true.",
       "type": "string"
      },
      "padForwardPayloadHeader": {
       "description": "PadForwardPayloadHeader determines whether padding should be added\nto the base64 encoded token forwarded with ForwardPayloadHeader.\n\n\nDefault value is false.",
       "type": "boolean"
      }
     },
     "type": "object"
    },
    "issuer": {
     "description": "Issuer is the entity that must have issued the JWT.\nThis value must match the \"iss\" claim of the token.",
     "type": "string"
    },
    "jsonWebKeySet": {
     "description": "JSONWebKeySet defines a JSON Web Key Set, its location on disk, or the\nmeans with which to fetch a key set from a remote server.",
     "properties": {
      "local": {
       "description": "Local specifies a local source for the key set.",
       "properties": {
        "filename": {
         "description": "Filename configures a location on disk where the JWKS can be\nfound. If specified, the file must be present on the disk of ALL\nproxies with intentions referencing this provider.",
         "type": "string"
        },
        "jwks": {
         "description": "JWKS contains a base64 encoded JWKS.",
         "type": "string"
        }
       },
       "type": "object"
      },
      "remote": {
       "description": "Remote specifies how to fetch a key set from a remote server.",
       "properties": {
        "cacheDuration": {
         "description": "CacheDuration is the duration after which cached keys\nshould be expired.\n\n\nDefault value is 5 minutes.",
         "type": "string"
        },
        "fetchAsynchronously": {
         "description": "FetchAsynchronously indicates that the JWKS should be fetched\nwhen a client request arrives. Client requests will be paused\nuntil the JWKS is fetched.\nIf false, the proxy listener will wait for the JWKS to be\nfetched before being activated.\n\n\nDefault value is false.",
         "type": "boolean"
        },
        "jwksCluster": {
         "description": "JWKSCluster defines how the specified Remote JWKS URI is to be fetched.",
         "properties": {
          "connectTimeout": {
           "description": "The timeout for new network connections to hosts in the cluster.\nIf not set, a default value of 5s will be used.",
           "type": "string"
          },
          "discoveryType": {
           "description": "DiscoveryType refers to the service discovery type to use for resolving the cluster.\n\n\nThis defaults to STRICT_DNS.\nOther options include STATIC, LOGICAL_DNS, EDS or ORIGINAL_DST.",
           "type": "string"
          },
          "tlsCertificates": {
           "description": "TLSCertificates refers to the data containing certificate authority certificates to use\nin verifying a presented peer certificate.\nIf not specified and a peer certificate is presented it will not be verified.\n\n\nMust be either CaCertificateProviderInstance or TrustedCA.",
           "properties": {
            "caCertificateProviderInstance": {
             "description": "CaCertificateProviderInstance Certificate provider instance for fetching TLS certificates.",
             "properties": {
              "certificateName": {
               "description": "CertificateName is used to specify certificate instances or types. For example, \"ROOTCA\" to specify\na root-certificate (validation context) or \"example.com\" to specify a certificate for a\nparticular domain.\n\n\nThe default value is the empty string.",
               "type": "string"
              },
              "instanceName": {
               "description": "InstanceName refers to the certificate provider instance name.\n\n\nThe default value is \"default\".",
               "type": "string"
              }
             },
             "type": "object"
            },
            "trustedCA": {
             "description": "TrustedCA defines TLS certificate data containing certificate authority certificates\nto use in verifying a presented peer certificate.\n\n\nExactly one of Filename, EnvironmentVariable, InlineString or InlineBytes must be specified.",
             "properties": {
              "environmentVariable": {
               "type": "string"
              },
              "filename": {
               "type": "string"
              },
              "inlineBytes": {
               "format": "byte",
               "type": "string"
              },
              "inlineString": {
               "type": "string"
              }
             },
             "type": "object"
            }
           },
           "type": "object"
          }
         },
         "type": "object"
        },
        "requestTimeoutMs": {
         "description": "RequestTimeoutMs is the number of milliseconds to\ntime out when making a request for the JWKS.",
         "type": "integer"
        },
        "retryPolicy": {
         "description": "RetryPolicy defines a retry policy for fetching JWKS.\n\n\nThere is no retry by default.",
         "properties": {
          "numRetries": {
           "description": "NumRetries is the number of times to retry fetching the JWKS.\nThe retry strategy uses jittered exponential backoff with\na base interval of 1s and max of 10s.\n\n\nDefault value is 0.",
           "type": "integer"
          },
          "retryPolicyBackOff": {
           "description": "Retry's backoff policy.\n\n\nDefaults to Envoy's backoff policy.",
           "properties": {
            "baseInterval": {
             "description": "BaseInterval to be used for the next back off computation.\n\n\nThe default value from envoy is 1s.",
             "type": "string"
            },
            "maxInterval": {
             "description": "MaxInternal to be used to specify the maximum interval between retries.\nOptional but should be greater or equal to BaseInterval.\n\n\nDefaults to 10 times BaseInterval.",
             "type": "string"
            }
           },
           "type": "object"
          }
         },
         "type": "object"
        },
        "uri": {
         "description": "URI is the URI of the server to query for the JWKS.",
         "type": "string"
        }
       },
       "type": "object"
      }
     },
     "type": "object"
    },
    "locations": {
     "description": "Locations where the JWT will be present in requests.\nEnvoy will check all of these locations to extract a JWT.\nIf no locations are specified Envoy will default to:\n1. Authorization header with Bearer schema:\n   \"Authorization: Bearer \u003ctoken\u003e\"\n2. accessToken query parameter.",
     "items": {
      "description": "JWTLocation is a location where the JWT could be present in requests.\n\n\nOnly one of Header, QueryParam, or Cookie can be specified.",
      "properties": {
       "cookie": {
        "description": "Cookie defines how to extract a JWT from an HTTP request cookie.",
        "properties": {
         "name": {
          "description": "Name is the name of the cookie containing the token.",
          "type": "string"
         }
        },
        "type": "object"
       },
       "header": {
        "description": "Header defines how to extract a JWT from an HTTP request header.",
        "properties": {
         "forward": {
          "description": "Forward defines whether the header with the JWT should be\nforwarded after the token has been verified. If false, the\nheader will not be forwarded to the backend.\n\n\nDefault value is false.",
          "type": "boolean"
         },
         "name": {
          "description": "Name is the name of the header containing the token.",
          "type": "string"
         },
         "valuePrefix": {
          "description": "ValuePrefix is an optional prefix that precedes the token in the\nheader value.\nFor example, \"Bearer \" is a standard value prefix for a header named\n\"Authorization\", but the prefix is not part of the token itself:\n\"Authorization: Bearer \u003ctoken\u003e\"",
          "type": "string"
         }
        },
        "type": "object"
       },
       "queryParam": {
        "description": "QueryParam defines how to extract a JWT from an HTTP request\nquery parameter.",
        "properties": {
         "name": {
          "description": "Name is the name of the query param containing the token.",
          "type": "string"
         }
        },
        "type": "object"
       }
      },
      "type": "object"
     },
     "type": "array"
    }
   },
   "type": "object"
  }
 },
 "title": "JWT Provider",
 "type": "object"
}
